func minimumOperations2(leaves string) int {
	var count int
	var r = []rune(leaves)
	if leaves[0] != 'r' {
		count++
		r[0] = 'r'
	}
	if leaves[len(r)-1] != 'r' {
		count++
		r[len(r)-1] = 'r'
	}

	leaves = strings.Trim(string(r), "r")
	//fmt.Println(leaves)
	n := len(leaves)
	if n == 0 { //
		return count + 1
	}

	arr := []int{} //ry

	var pre byte
	var countR, countY int
	var totalR int
	for i := 0; i < n; i++ {
		if leaves[i] == 'r' {
			totalR++
		}
		if leaves[i] != pre {
			if leaves[i] == 'r' {
				arr = append(arr, 1)
				countR++
			} else {
				arr = append(arr, 1)
				countY++
			}
			pre = leaves[i]
		} else {
			arr[len(arr)-1]++
		}
	}

	if countR == 0 { //0
		return count
	}

	var totalY = len(leaves) - totalR
	var count1 int = 100000 //

	for i := 0; i < len(arr); i++ {
		if i%2 == 0 { //y
			for j := i; j < len(arr); j = j + 2 {
				changeR, notChangeY := 0, 0
				for k := i; k <= j; k++ {
					if k%2 == 1 { //r
						changeR += arr[k]
					} else { //y
						notChangeY += arr[k]
					}
				}
				changeTotal := changeR + totalY - notChangeY

				count1 = min(count1, changeTotal)
			}
		}
	}

	return count + count1
}

//
func minimumOperations3(leaves string) int {
	var count int
	if leaves[0] != 'r' {
		count++
		leaves = "r" + leaves[1:]
	}
	if leaves[len(leaves)-1] != 'r' {
		count++
		leaves = leaves[:len(leaves)-1] + "r"
	}

	leaves = strings.Trim(leaves, "r")
	n := len(leaves)
	if n == 0 { //
		return count + 1
	}

	arr := []int{} //ry

	var pre byte
	var countR int
	var totalR int
	for i := 0; i < n; i++ {
		if leaves[i] == 'r' {
			totalR++
		}
		if leaves[i] != pre {
			if leaves[i] == 'r' {
				arr = append(arr, 1)
				countR++
			} else {
				arr = append(arr, 1)
			}
			pre = leaves[i]
		} else {
			arr[len(arr)-1]++
		}
	}

	if countR == 0 { //0
		return count
	}

	var totalY = len(leaves) - totalR
	var count1 int = 100000 //

	for i := 0; i < len(arr); i = i + 2 {
		changeR, notChangeY := 0, 0

		for j := i; j < len(arr); j = j + 2 {
			notChangeY += arr[j]
			if i != j {
				changeR += arr[j-1]
			}
			changeTotal := changeR + totalY - notChangeY

			count1 = min(count1, changeTotal)
		}
	}

	return count + count1
}

func min(a, b int) int {
	if a > b {
		return b
	}
	return a
}

