func minimumOperations4(leaves string) int {
	l := len(leaves)
	if l < 3 {
		return -1
	}
	var ans int
	//pre handle
	if leaves[0] == 'y' {
		ans++
	}
	if leaves[l-1] == 'y' {
		ans++
	}

	//
	//
	//dp[][0]
	//dp[][1]
	//dp[][2]
	var dp [][3]int
	for i := 0; i < l-1; i++ {
		dp = append(dp, [3]int{})
	}
	for i := 1; i < l-1; i++ {
		if leaves[i] == 'y' {
			dp[i][0] = dp[i-1][0] + 1
			dp[i][1] = min(dp[i-1][0], dp[i-1][1])
			if i > 1 {
				dp[i][2] = min(dp[i-1][1], dp[i-1][2]) + 1
			} else {
				dp[i][2] = dp[i][1]
			}
		} else {
			dp[i][0] = dp[i-1][0]
			dp[i][1] = min(dp[i-1][0], dp[i-1][1]) + 1
			if i > 1 {
				dp[i][2] = min(dp[i-1][2], dp[i-1][1])
			} else {
				dp[i][2] = dp[i][1]
			}
		}
	}
	//
	return ans + min(dp[l-2][1], dp[l-2][2])
}

//24 ms	9.6 MB
func minimumOperations5(leaves string) int {
	n := len(leaves)
	dp := [3][]int{}
	for i := 0; i < 3; i++ {
		dp[i] = make([]int, n)
	}
	// 
	//  ryr
	// 1. r
	// 2. ry
	// 3. ryr
	INF := int(1e8) // 
	if leaves[0] == 'r' {
		dp[0][0] = 0   //r,1
		dp[1][0] = INF //1
		dp[2][0] = INF //1
	} else {
		dp[0][0] = 1 //y
		dp[1][0] = INF
		dp[2][0] = INF
	}
	dp[2][1] = INF // 23

	for i := 1; i < n; i++ {
		if leaves[i] == 'r' {
			dp[0][i] = dp[0][i-1]                      //r
			dp[1][i] = min(dp[0][i-1], dp[1][i-1]) + 1 //212+1
			dp[2][i] = min(dp[1][i-1], dp[2][i-1])
		} else {
			dp[0][i] = dp[0][i-1] + 1 //yr
			dp[1][i] = min(dp[0][i-1], dp[1][i-1])
			dp[2][i] = min(dp[1][i-1], dp[2][i-1]) + 1
		}
	}
	return dp[2][n-1]
}

const inf = math.MaxInt32

//16 ms	9 MB
func minimumOperationsOfficial1(leaves string) int {
	n := len(leaves)
	if n < 3 {
		return -1
	}
	//021
	f := make([][3]int, n) //f[i][j]0iij
	f[0][0] = boolToInt(leaves[0] == 'y')
	f[0][1] = inf
	f[0][2] = inf
	f[1][2] = inf
	for i := 1; i < n; i++ {
		isRed := boolToInt(leaves[i] == 'r')
		isYellow := boolToInt(leaves[i] == 'y')
		f[i][0] = f[i-1][0] + isYellow
		f[i][1] = min(f[i-1][0], f[i-1][1]) + isRed
		if i >= 2 {
			f[i][2] = min(f[i-1][1], f[i-1][2]) + isYellow
		}
	}
	return f[n-1][2]
}

func boolToInt(b bool) int {
	if b {
		return 1
	}
	return 0
}

